import React, { Component } from 'react';

class Form extends Component {
  render() {
    return(
      <form
      className="input"
      onSubmit={(e) => this.handleSubmit(e)}>
      <input
      placeholder="Whatcha Thinkin?"
      onChange= {(e) => this.handleChange(e)}
       />
      <button>Click Here</button>
      </form>
      )
  }
}

export default Form
